a.wtag-button{display:inline-block;text-decoration:none;padding:8px 16px;cursor:pointer;width:auto;background-color:#06C;background-image:linear-gradient(center top,#06B,#047);background-image:-moz-linear-gradient(center top,#06B,#047);background-image:-webkit-linear-gradient(center top,#06B,#047);background-image:-ms-linear-gradient(center top,#06B,#047);color:#fff;text-shadow:0 -1px rgba(0,0,0,.5);border:2px solid #000;border-radius:4px;box-shadow:4px 4px 2px rgba(0,0,0,.4);margin:4px;font-weight:500;font-size:90%;transition:all .2s;-webkit-transition:all .2s;-ms-transition:all .2s}
a.wtag-button:active{transform:translateX(4px) translateY(4px);-moz-transform:translateX(4px) translateY(4px);-webkit-transform:translateX(4px) translateY(4px);-ms-transform:translateX(4px) translateY(4px);box-shadow:0 0 2px rgba(0,0,0,.4)}a.wtag-button.green,a[data-checked="1"].wtag-button{background-color:#0C6;background-image:linear-gradient(center top,#0B0,#070);background-image:-moz-linear-gradient(center top,#0B0,#070);background-image:-webkit-linear-gradient(center top,#0B0,#070);background-image:-ms-linear-gradient(center top,#0B0,#070)}
a[data-checked="0"].wtag-button{background-color:#655;background-image:linear-gradient(center top,#877,#544);background-image:-moz-linear-gradient(center top,#877,#544);background-image:-webkit-linear-gradient(center top,#877,#544);background-image:-ms-linear-gradient(center top,#877,#544);color:#ccc}
